    &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 20 &lt;/li&gt;\n          &lt;li&gt; Memory: 17.18 GB &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10)\n\n    #print(\"create dataframe\")\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            print(\"i rand access: \", i, flush=True)\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"format":"0.0 b"},"id":"1171","type":"NumeralTickFormatter"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1146"}},"height":{"units":"data","value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1146"}},"width":{"units":"data","value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1167","type":"Rect"},{"attributes":{"source":{"id":"1001"}},"id":"1033","type":"CDSView"},{"attributes":{},"id":"1243","type":"BasicTickFormatter"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1254","type":"DaysTicker"},{"attributes":{},"id":"1073","type":"DataRange1d"},{"attributes":{"source":{"id":"1145"}},"id":"1169","type":"CDSView"},{"attributes":{},"id":"1005","type":"DataRange1d"},{"attributes":{"data_source":{"id":"1145"},"glyph":{"id":"1166"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1167"},"selection_glyph":null,"view":{"id":"1169"}},"id":"1168","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"1001"},"glyph":{"id":"1030"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1033"}},"id":"1032","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"1050"},"dimension":1,"ticker":null,"visible":false},"id":"1053","type":"Grid"},{"attributes":{"color_mapper":{"id":"1146"},"formatter":{"id":"1171"},"label_standoff":12,"location":[0,0],"ticker":{"id":"1173"}},"id":"1170","type":"ColorBar"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Filename:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font
